script: |
  super -f text -I q1662.spq | sort > q1662.out

inputs:
  - name: q1662.spq
    data: |
      SELECT DISTINCT - ( + col1 ) + - col1 AS col1, - 41 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT col1 * - 57 + - col2 + - col2 <> CAST ( + + col1 AS INTEGER ) + col2;
  - name: tab1

outputs:
  - name: q1662.out
    data: |
